import React from "react";
import Header from "./components/Header";
import Page from "./components/PageSuccess";
import { Route, Routes } from "react-router-dom";
const App = () => {
  return (
   <Routes>
     <Route path='/' element={<Header />} />
      <Route path='success' element={<Page />} />
      
       
      </Routes>
  );
};
export default App;
